oxy_webhelp_navlinks = {"sh_import_files_into_docs_c-d4800e5341":{"topics":[{"title":"Importing text files","shortdesc":"<p class=\"shortdesc\">You can import rich-text files, ASCII text files, and word processing files into a rich-text field in an HCL Notes® document.<\/p>","href":"sh_import_text_files_to_doc_t.html","attributes":{"data-id":"sh_import_text_files_to_doc_t"},"menu":{"hasChildren":true},"tocID":"sh_import_text_files_to_doc_t-d4800e5352","next":"sh_import_text_files_to_doc_t-d4800e5352"},{"title":"How can I import HTML files?","shortdesc":"<p class=\"shortdesc\">You can import the text of an HTML file, and the graphics if they are stored locally, into an HCL Notes® rich-text field.<\/p>","href":"sh_import_html_file_to_doc_t.html","attributes":{"data-id":"sh_import_html_file_to_doc_t"},"menu":{"hasChildren":false},"tocID":"sh_import_html_file_to_doc_t-d4800e5405","topics":[]},{"title":"How can I import graphics files? ","shortdesc":"<p class=\"shortdesc\">You can import several types of graphics files -- BMP, CGM, GIF, JPEG, ® PIC, PCX, and TIFF 5.0 -- into a rich-text field in an HCL Notes® document. <\/p>","href":"sh_import_graphic_file_to_doc_t.html","attributes":{"data-id":"sh_import_graphic_file_to_doc_t"},"menu":{"hasChildren":false},"tocID":"sh_import_graphic_file_to_doc_t-d4800e5419","topics":[]},{"title":"How can I import spreadsheet files into documents that have rich-text fields?","shortdesc":"<p class=\"shortdesc\">You can import Microsoft™ Excel spreadsheet files into a rich-text field in a document. An imported spreadsheet becomes a table.<\/p>","href":"sh_import_spreadsheet_to_doc_t.html","attributes":{"data-id":"sh_import_spreadsheet_to_doc_t"},"menu":{"hasChildren":false},"tocID":"sh_import_spreadsheet_to_doc_t-d4800e5435","topics":[]}]}};